import React from "react";
import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";
import styled from "styled-components";
// Pages
import FirstPage from './component/FirstPage';
import SecondPage from './component/SecondPage';

const GlobalStyle = createGlobalStyle`
  @font-face {
    font-family: 'NanumNeo';
    src: url('/NanumSquareNeoOTF-Rg.otf') format('truetype');
    /* Additional font styles and weights can be added here */
  }

  body {
    font-family: 'NanumNeo', sans-serif;
    /* Other styles can be added here */
  }
`;

function App(props) {
    return (
      <>
        <GlobalStyle /> {/* Add GlobalStyle at the root */}
        <BrowserRouter>
          <Routes>
            <Route index element={<FirstPage />} />
            <Route path="second-page" element={<SecondPage />} />
          </Routes>
        </BrowserRouter>
      </>
    );
    }

export default App;
